import React from 'react'
import {ChakraProvider, Container, Box, Stack, Divider, Text, Center } from '@chakra-ui/react'
import Header from './Components/Header/Header'

const Feed = () => {
    const tl_border = {
        borderLeft: "1px solid #38444D",
        borderRight: "1px solid #38444D",
        borderTop: "1px solid #38444D"
      };

    return (
        <ChakraProvider>
            <Container style={tl_border}  w="600px" h="100vh">
                <Header />
            </Container>
        </ChakraProvider>
    )
}

export default Feed
